import React from 'react'
import {ListGroupItem} from 'reactstrap'
function ExpenseItem({ item }) {
    return (
        <ListGroupItem>
        <div className="float-start">
            <span>{item.description}</span>
        </div>
        <div className="float-end">
        <span>{item.amount}</span>
        </div>
        </ListGroupItem>
    )
}

export { ExpenseItem }
